	.google-map-contact-wrapper{position:static;margin-left:0!important;}
	.google-map-contact-wrapper .get_in_touch{float:none;width:100%;-webkit-box-sizing:border-box;box-sizing:border-box}
	.google-map-contact-wrapper .get_in_touch:after{display:none;}
	
	/* How it works */
	.how_it_works .image,.with_aside .how_it_works .image{width:196px;height:196px;line-height:194px}
	.how_it_works .image img{max-width:116px!important;max-height:116px!important}
	.how_it_works .image .number,.with_aside .how_it_works .image .number{bottom:10px;right:10px}
	.how_it_works.has_border:after{display:none}
	
	.with_aside .how_it_works .image img{max-width:116px!important;max-height:116px!important}
	.with_aside .how_it_works.fill .image img{max-width:196px!important;max-height:196px!important}
	
	/* Offer slider */
	.offer .offer_li .image_wrapper{width:100%;float:none;margin-bottom:15px;overflow:hidden}
	.offer .offer_li .desc_wrapper{width:90%;width:calc(100% - 67px)!important;margin:0 auto;float:none;clear:both}
	.offer .offer_li .desc_wrapper .title{padding-right:0;margin-bottom:15px}
	.offer .offer_li .desc_wrapper .title h3{margin-bottom:15px;font-size:27px;line-height:27px}
	.offer .offer_li .desc_wrapper .title a.button{position:relative}
	.offer a.slider_prev{left:20px;top:20px;margin:0}
	.offer .slider_pagination{left:20px;top:65px;margin:0}
	.offer a.slider_next{left:20px;top:111px;margin:0}
	.button-stroke .offer a.slider_prev{margin-top:-8px}
	.button-stroke .offer a.slider_next{margin-top:6px}
	
	/* Icon box */
	.icon_box.has_border:after{display:none}
	
	/* Image Frame */
	.image_frame{margin-top:0!important}
	
	/* Offer thumb */
	.offer_thumb{padding-left:0}
	.offer_thumb_ul li.offer_thumb_li{padding-left:0}
	.offer_thumb_ul li.offer_thumb_li .image_wrapper{width:100%;float:none}
	.offer_thumb_ul li.offer_thumb_li .desc_wrapper{width:100%;float:none}
	.offer_thumb_ul li.offer_thumb_li .desc_wrapper .title{padding-right:0}
	.offer_thumb_ul li.offer_thumb_li .desc_wrapper .title h3{margin-bottom:15px}
	.offer_thumb_ul li.offer_thumb_li .desc_wrapper .title a.button{position:relative}
	.offer_thumb .slider_pagination{margin-top:20px;line-height:inherit}
	
	/* Offer thumb bottom */
	.offer_thumb.bottom .offer_thumb_ul li.offer_thumb_li .image_wrapper{width:100%}
	.offer_thumb.bottom .offer_thumb_ul li.offer_thumb_li .desc_wrapper{margin-right:0;width:100%}
	
	/* Pricing table */
	.pricing-box-label .plan-header,.pricing-box-label .plan-footer{display:none}
	.pricing-box-label ul li{text-align:center!important}

	/* Promo box */
	.promo_box.has_border:after{display:none}
	.promo_box_wrapper{overflow:visible}
	.promo_box_wrapper .photo_wrapper{width:100%;float:none;line-height:0;margin-bottom:15px}
	.promo_box_wrapper .desc_wrapper{width:100%;margin:0!important;float:none;padding-top:0}
	
	/* Story Box */
	.story_box{padding:0 11%!important}
	.story_box .desc_wrapper{margin-right:0!important}
	
	/* Table */
	.table-responsive table{overflow-x:auto;display:block}
	.table-responsive table a.kill_the_icon .button_icon{display:none}
	
	/* Tabs */
	.ui-tabs .ui-tabs-nav{background:none}
	.ui-tabs .ui-tabs-nav li{float:none!important;width:100%!important;border-width:0 0 1px}
	.ui-tabs .ui-tabs-nav li:last-child{border-bottom:0}
	.ui-tabs .ui-tabs-nav li a{text-align:center;background-image:url(/23e4bb9bcd0b199cc3eeeaa243d4c592.png);background-repeat:repeat-x;background-position:left top}
	.ui-tabs .ui-tabs-nav li.ui-tabs-selected a,.ui-tabs .ui-tabs-nav li.ui-state-active a{background-image:none}
	.ui-tabs .ui-tabs-nav li.ui-tabs-selected:after,.ui-tabs .ui-tabs-nav li.ui-state-active:after{display:none}
	.ui-tabs .ui-tabs-nav li.ui-tabs-selected a:after,.ui-tabs .ui-tabs-nav li.ui-state-disabled a:after,.ui-tabs .ui-tabs-nav li.ui-state-processing a:after,.ui-tabs .ui-tabs-nav li.ui-state-active a:after{display:none}

	/* Tabs: simple-style */
	.style-simple .ui-tabs .ui-tabs-nav li a{background-image:none}
	.style-simple .ui-tabs .ui-tabs-nav li.ui-tabs-selected a:after,.style-simple .ui-tabs .ui-tabs-nav li.ui-state-disabled a:after,.style-simple .ui-tabs .ui-tabs-nav li.ui-state-processing a:after,.style-simple .ui-tabs .ui-tabs-nav li.ui-state-active a:after{display:block}
	
	/* Tabs vertical: simple-style */
	.style-simple .tabs_vertical.ui-tabs .ui-tabs-nav li a{text-align:center;padding-right:20px}
	.style-simple .tabs_vertical.ui-tabs .ui-tabs-panel{border-width:1px 0 0!important}
	.style-simple .tabs_vertical.ui-tabs .ui-tabs-nav li.ui-tabs-selected a:after,.style-simple .tabs_vertical.ui-tabs .ui-tabs-nav li.ui-state-disabled a:after,.style-simple .tabs_vertical.ui-tabs .ui-tabs-nav li.ui-state-processing a:after,.style-simple .tabs_vertical.ui-tabs .ui-tabs-nav li.ui-state-active a:after{display:block;width:100%;height:2px;left:0;top:auto;bottom:0;right:auto}
	
	/* Testimonials list */
	.testimonials_list .item{margin-bottom:30px}
	.testimonials_list .item .photo{width:100%;float:none;margin-bottom:10px}
	.testimonials_list .item .desc{width:100%;float:none;margin-bottom:0}
	
	/* Timeline */
	.timeline_items{background-position:91px top}
	.timeline_items > li{padding:0 0 25px 150px !important;background:url(/c13da784e1dddd9d57e4c560158abe2e.png) no-repeat!important;background-position:50px top!important;width:auto}
	.timeline_items > li h3 span{left:0!important;right:auto}
	.timeline_items > li h3,
	.timeline_items > li:nth-child(even) h3{text-align:left}
	.timeline_items > li h3:before{left:93px}
	.timeline_items > li .desc,
	.timeline_items > li:nth-child(even) .desc{text-align:left}
	.timeline_items > li .desc:before{display:none}
	.timeline_items:after{left:93px}

	/* General -------------------- */

	/* Error 404 */
	#Error_404{position:static;padding-top:20px;margin-top:0}
	#Error_404 .error_pic{width:100%;float:none}
	#Error_404 .error_pic i{font-size:160px;line-height:160px}
	#Error_404 .error_desk{width:100%;float:none;padding-top:20px;text-align:center}
	#Error_404 .error_desk h2{font-size:30px;line-height:30px}
	#Error_404 .error_desk h4{font-size:19px;line-height:25px}
	#Error_404 .error_desk p .check{line-height:22px;font-size:16px;margin-bottom:15px;display:block}

	/* Filters */
	#Filters .filters_wrapper ul li{float:left;width:49%;margin:.5%}

	/* Fixed nav */
	.fixed-nav{display:none!important}
	
	/* Popup contact */
	#popup_contact{display:none}
	
	/* Search Results */
	.search-not-found .snf-pic{width:100%;float:none}
	.search-not-found .snf-pic i{font-size:260px;line-height:260px}
	.search-not-found .snf-desc{width:100%;float:none;padding-top:20px;text-align:center}
	
	/* Video */
	/* In this case, the aspect ratio is 16:9, which means that the height will be 56.25% of the width. For a video with a 4:3 aspect ratio, we set padding-bottom to 75%. */
	.content_video.iframe{position:relative;padding-bottom:56.25%;height:0;overflow:hidden}
	.content_video.iframe iframe{position:absolute;top:0;left:0;width:100%;height:100%}

	/* WordPress Admin Bar */
	.admin-bar #wpadminbar{z-index:9999!important;position:fixed}
	
	/* Plugins --------------- */

	/* bbPress */
	.bbpress ul{font-size:13px}
	.bbpress li.bbp-forum-info,.bbpress li.bbp-topic-title{width:44%}
	.bbpress li.bbp-forum-topic-count,.bbpress li.bbp-topic-voice-count,.bbpress li.bbp-forum-reply-count,.bbpress li.bbp-topic-reply-count{width:15%}
	.bbpress .bbp-body li.bbp-forum-freshness,.bbpress .bbp-body li.bbp-topic-freshness{line-height:16px;font-size:11px}
	
	/* Easy Digital Downloads */
	.edd_downloads_list .edd_download{width:100%!important}
	.edd_downloads_list .edd_download .edd_download_inner{margin:0 8% 20px}
	
	/* Pretty Photo Popup */
	
	/* Tiny popup on mobile | fix */
	.pp_pic_holder{width:90%!important;left:5%!important;overflow:hidden}
	.pp_content{width:98%!important;height:auto!important}
	.pp_fade{width:100%!important;height:100%!important}
	a.pp_expand,a.pp_contract,.pp_hoverContainer,.pp_gallery{display:none!important}
	#pp_full_res img{width:100%!important;height:auto!important}
	.pp_details{width:100%!important;position:static!important;min-height:25px}
	.pp_details a.pp_close{top:auto;right:25px}
	
	/* Theme Options size | fix */
	div.pp_pic_holder,div.pp_content,div.pp_details{max-width:100%}
	div.pp_content{overflow:auto}
	
}


/* #Tablet (Portrait) & Mobile (Landscape) 480 - 768 ----------------------- #Tablet (Portrait) & Mobile (Landscape) 480 - 768 */

@media only screen and (min-width: 480px) and (max-width: 767px)
{
	/* Respond */
	#respond .comment-form-author{width:100%;margin-right:0;float:none}
	#respond .comment-form-email{width:100%;margin-right:0;float:none}
	#respond .comment-form-url{width:100%;float:none}
	#respond input[type="text"],#respond input[type="password"],#respond input[type="email"],#respond select{width:100%}
	#respond .comment-form-comment textarea{width:100%}
	#respond .required{right:15px}
	#comments .commentlist > li .comment-body{margin-left:90px;padding:10px}
	#comments .commentlist > li .photo{left:-90px}
	#comments .commentlist > li .children{margin-left:0;padding-left:10px}
	#comments .commentlist > li .reply{right:10px;top:10px}
	#comments .commentlist > li .comment-meta a.comment-edit-link{padding-right:45px}
	.rtl #comments .commentlist > li .comment-body{margin-left:0;margin-right:90px}
	.rtl #comments .commentlist > li .photo{left:auto;right:-90px}
	.rtl #comments .commentlist > li .children{margin-right:0;padding-left:0;padding-right:10px}
	.rtl #comments .commentlist > li .reply{left:10px;right:auto}
	.rtl #comments .commentlist > li .comment-meta a.comment-edit-link{padding-left:45px;padding-right:0}
	
	/* Zoom Box */
	.zoom_box .desc .desc_txt{font-size:18px;line-height:22px}
	
	/* Gallery */
	#Content .gallery:not(.gallery-columns-1) .gallery-item{width:50%;clear:none}
	#Content .gallery:not(.gallery-columns-1) .gallery-item:nth-of-type(2n+1){clear:both}
	
	/* Latest News */
	.Latest_news.featured ul{width:49%!important}
}


/* #Mobile (Portrait) < 480 ------------------------------------------------------------------------- #Mobile (Portrait) < 480 */

@media only screen and (min-width: 448px) and (max-width: 500px)
{
	.blog_slider a.kill_the_icon .button_icon{display:none;}
}	

@media only screen and (max-width: 479px)
{
	#Top_bar a.button.action_button{margin-right:0}
	
	/* Post nav */
	.post-nav{padding:10px 10px 4px}
	
	/* Portfolio list */
	body:not(.with_aside) .portfolio_group.list .portfolio-item .portfolio-item-fw-wrapper{width:260px}
	
	/* Portfolio Masonry Flat */
	.portfolio_group.masonry-flat .portfolio-item,.portfolio_group.masonry-flat .portfolio-item.wide{width:100%!important}
	
	/* Latest News */
	.Latest_news.featured ul{width:100%!important}
	
	/* Filters */
	#Filters .filters_buttons li{margin-right:10px}
	#Filters .filters_buttons li.label{display:none}
	#Filters .filters_buttons li i.icon-docs,#Filters .filters_buttons li i.icon-tag{display:none}
	
	/* Team */
	.team.team_horizontal .image_frame{width:100%;margin:0 0 15px;float:none}
	.team.team_horizontal .desc_wrapper{width:100%;float:none}
	
	/* Timeline */
	.timeline_items{background-position:21px top}
	.timeline_items > li{padding:0 0 25px 80px !important;background-position:-20px top!important}
	.timeline_items > li h3 span{display:table;position:relative;margin-bottom:20px;clear:both}
	.timeline_items > li h3:before{left:24px}
	.timeline_items:after{left:23px}
	
	/* Testimonials slider */
	.testimonials_slider a.slider_prev{display:none!important}
	.testimonials_slider a.slider_next{display:none!important}
	.testimonials_slider .testimonials_slider_ul li{padding:0}
	
	/* Respond */
	#respond .comment-form-author{width:99%;margin-right:0;float:none}
	#respond .comment-form-email{width:99%;margin-right:0;float:none}
	#respond .comment-form-url{width:99%;float:none}
	#respond input[type="text"],#respond input[type="password"],#respond input[type="email"],#respond select{width:100%}
	#respond .comment-form-comment textarea{width:100%}
	#respond .required{right:11px}
	#comments .commentlist > li .comment-body{margin-left:55px;padding:10px}
	#comments .commentlist > li .photo{width:32px;height:32px;left:-55px}
	#comments .commentlist > li .children{margin-left:0;padding-left:10px}
	#comments .commentlist > li .reply{right:10px;top:10px}
	#comments .commentlist > li .comment-meta a.comment-edit-link{padding-right:0;position:static;float:none}
	.rtl #comments .commentlist > li .comment-body{margin-left:0;margin-right:55px}
	.rtl #comments .commentlist > li .photo{left:auto;right:-55px}
	.rtl #comments .commentlist > li .children{margin-right:0;padding-left:0;padding-right:10px}
	.rtl #comments .commentlist > li .reply{left:10px;right:auto}
	.rtl #comments .commentlist > li .comment-meta a.comment-edit-link{padding:0}
	
	/* Zoom Box */
	.zoom_box .desc .desc_img img{max-height:60px;width:auto}
	.zoom_box .desc .desc_txt{font-size:14px;line-height:17px}
	
	/* Feature box */
	.feature_box .feature_box_wrapper{display:block}
	.feature_box .feature_box_wrapper .photo_wrapper,.feature_box .feature_box_wrapper .desc_wrapper{display:block;width:100%;padding:0}
	.feature_box .feature_box_wrapper .photo_wrapper{margin-bottom:15px;text-align:center}
	.feature_box .feature_box_wrapper .photo_wrapper a{display:inline-block}
	
	/* Gallery */
	#Content .gallery .gallery-item{width:100%}
	
	/* bbpress */
	.bbpress #bbpress-forums p.bbp-topic-meta,.bbpress #bbpress-forums p.bbp-topic-meta{display:none}
	
	/* Easy Digital Downloads */
	.edd_downloads_list .edd_download{width:100%!important}
	.edd_downloads_list .edd_download .edd_download_inner{margin:0 0 20px}
}


/* Retina | iPad ----------------------------------------------------------------------------------------------- Retina | iPad */
@media only screen and (max-device-width: 1024px){
	html.ios, .ios .section.bg-cover{background-attachment:scroll!important}
}

sources.responsiveEFB996ver=18.css:
html,body{overflow-x:hidden}

/* > 1240 ------------------------------------------------------------------------------------------------------------- > 1240 */

@media only screen and (min-width: 1240px)
{	
	.layout-boxed{padding:25px}
	.layout-boxed.nice-scroll{padding:25px 25px 25px 15px}
	.layout-boxed.boxed-no-margin{padding:0;}
	#Top_bar.loading{display:none}
	
	.hover_color:hover .hover_color_bg,.hover_color.hover .hover_color_bg{background-color:inherit!important;border-color:inherit!important}
}


/* #Header Creative always Open	1240 - 1489 ----------------------------------------- #Header Creative always Open 1240 - 1489 */

@media only screen and (min-width: 1240px) and (max-width: 1489px)
{	
	body.header-open							{min-width:0;}
	.header-open #Wrapper 						{max-width:960px;}
	
	.header-open .section_wrapper,
	.header-open .container,
	.header-open.with_aside .content_wrapper	{max-width:940px;}
	
	.header-open.with_aside .section_wrapper	{max-width:100%;}

	/* -------------------- */
	
	/* Error 404 */
	.header-open #Error_404 .error_pic i{font-size:220px;line-height:260px}
	.header-open #Error_404 .error_desk{padding-top:40px}
	
	/* Google maps */
	.header-open .section.full-width .wrap.one .column_map.one .google-map-contact-wrapper{left:auto;right:50px;}
	
	/* Offer slider */
	.header-open .offer .offer_li .desc_wrapper{width:436px;width:calc(50% - 42px)}
	
	/* Portfolio list */
	body.header-open:not(.with_aside) .portfolio_group.list .portfolio-item .portfolio-item-fw-wrapper{width:921px}
	
	/* Recent posts */
	.header-open .Recent_posts ul li .desc{margin-right:60px}
	.header-open .Recent_posts ul li .photo{width:60px;height:60px}
	.header-open .Recent_posts ul li .photo .c{width:20px;height:20px;line-height:20px;bottom:5px;right:-8px}
}


/* < 1240 ------------------------------------------------------------------------------------------------------------- < 1240 */

@media only screen and (max-width: 1239px)
{
	/* iOS phone number linking */
	a[href^=tel]{color:inherit;text-decoration:none}
	
	/* Hover Effect */
	.no-hover-tablet a.button:after,.no-hover-tablet a.tp-button:after,.no-hover-tablet button:after,.no-hover-tablet input:after{display:none}
	.no-hover-tablet .image_frame .image_wrapper img{top:0!important}
	.no-hover-tablet .image_frame:not(.no_link) .image_wrapper img:not(.ls-l){margin-bottom:0!important}
	.no-hover-tablet .image_frame .image_wrapper .mask,.no-hover-tablet .image_frame .image_wrapper .image_links{display:none!important}
	.no-hover-tablet .Recent_posts ul li .desc:after{display:none}
	.no-hover-tablet .Recent_posts ul li a:hover h6,.no-hover-tablet .Recent_posts ul li a:hover .desc .date{color:inherit!important}

	body:not(.no-hover-tablet) .hover_color:hover .hover_color_bg,
	body:not(.no-hover-tablet) .hover_color.hover .hover_color_bg{background-color:inherit!important;border-color:inherit!important}

	/* Portfolio masonry hover */
	.with_aside .portfolio_group.masonry-hover .portfolio-item:not(.no-thumbnail) .masonry-hover-wrapper .hover-desc .desc-inner .desc-wrappper{display:none}
	
	/* Section Background Image */
	.no-section-bg-tablet .section{background-image:none!important}
	
	/* Google maps */
	.section.full-width .wrap.one .column_map.one .google-map-contact-wrapper{left:auto;right:50px;}
}
	
	
/* #Desktop	960 - 1239 ---------------------------------------------------------------------------------- #Desktop	960 - 1239 */

@media only screen and (min-width: 960px) and (max-width: 1239px)
{	
	body 							{min-width:0; }
	#Wrapper 						{max-width:960px;}
	
	.section_wrapper,
	.container,
	.with_aside .content_wrapper	{max-width:940px;}

	/* -------------------- */
	
	/* Top bar width */
	#Top_bar .top_bar_left{width:729px}
	
	/* Blog | Columns | Grid, Masonry */
	.posts_group.grid.col-5 .post-item,.posts_group.masonry.col-5 .post-item,.posts_group.grid.col-6 .post-item,.posts_group.masonry.col-6 .post-item{width:22.99%}
	.posts_group.grid.col-5 .post-item:nth-child(5n+1){clear:none}
	.posts_group.grid.col-6 .post-item:nth-child(6n+1){clear:none}
	.posts_group.grid.col-5 .post-item:nth-child(4n+1){clear:both}
	.posts_group.grid.col-6 .post-item:nth-child(4n+1){clear:both}
	
	/* Latest News */
	.column.one-fourth .Latest_news ul .desc .date i{display:none}
	.column.one-second .Latest_news.featured ul .desc .date i{display:none}
	.wrap.two-third .column.three-fifth .Latest_news.featured ul,.wrap.two-third .column.one-second .Latest_news.featured ul,.wrap.three-fifth .column.three-fifth .Latest_news.featured ul,.wrap.three-fifth .column.one-second .Latest_news.featured ul,.wrap.one-second .column.three-fourth .Latest_news.featured ul{width:100%}
	.wrap.two-fifth .Latest_news.featured ul,.wrap.one-third .Latest_news.featured ul,.wrap.one-fourth .Latest_news.featured ul{width:100%}

	/* Blog Teaser */
	.blog-teaser li:not(:first-child) .desc-wrapper .desc{padding:70px 20px 25px;}
	
	.column.two-third .blog-teaser li:not(:first-child) .desc-wrapper .desc .post-meta,
	.column.three-fifth .blog-teaser li:not(:first-child) .desc-wrapper .desc .post-meta{display:none;}
	.wrap.two-third .blog-teaser li:not(:first-child) .desc-wrapper .desc .post-meta,
	.wrap.three-fifth .blog-teaser li:not(:first-child) .desc-wrapper .desc .post-meta{display:none;}

	/* Portfolio | List */
	body:not(.with_aside) .portfolio_group.list .portfolio-item .portfolio-item-fw-wrapper{width:921px}

		/* Portfolio | Columns | Grid, Masonry, Masonry Hover */
		.portfolio_group.grid.col-5 .portfolio-item,
		.portfolio_group.masonry.col-5 .portfolio-item,
		.portfolio_group.masonry-hover.col-5 .portfolio-item,
		.portfolio_group.masonry-minimal.col-5 .portfolio-item,
		.portfolio_group.grid.col-6 .portfolio-item,
		.portfolio_group.masonry.col-6 .portfolio-item,
		.portfolio_group.masonry-hover.col-6 .portfolio-item,
		.portfolio_group.masonry-minimal.col-6 .portfolio-item{width:22.99%}
		
		/* Portfolio | Columns | Flat */			
		.portfolio_group.flat.col-5 .portfolio-item,
		.portfolio_group.flat.col-6 .portfolio-item{width:24.99%}

	/* Error 404 */
	#Error_404 .error_pic i{font-size:220px;line-height:260px}
	#Error_404 .error_desk{padding-top:40px}
	
	/* Button */
	a.button.kill_the_icon .button_icon{padding-left:10px;padding-right:10px;}
	a.button.kill_the_icon .button_label{padding-left:15px;padding-right:15px;}
	
	/* Offer slider */
	.offer .offer_li .desc_wrapper{width:436px;width:calc(50% - 42px)}
	
	/* Recent posts */
	.Recent_posts ul li .desc{margin-right:60px}
	.Recent_posts ul li .photo{width:60px;height:60px}
	.Recent_posts ul li .photo .c{width:20px;height:20px;line-height:20px;bottom:5px;right:-8px}
	
	/* Zoom Box */
	.zoom_box .desc .desc_txt{font-size:22px;line-height:26px}
}


/* #Desktop	> 960 -------------------------------------------------------------------------------------------- #Desktop	> 960 */

@media only screen and (min-width: 960px)
{	
	.hide-desktop{display:none!important}
}


/* #Tablet (Landscape) 768 - 959 --------------------------------------------------------------- #Tablet (Landscape) 768 - 959 */

@media only screen and (min-width: 768px) and (max-width: 959px)
{	
	body							{min-width:0;}
	#Wrapper						{max-width:728px;}

	.section_wrapper,
	.container,
	.with_aside .content_wrapper	{max-width:708px;}
	
	/* -------------------- */

